import React, {useState} from 'react'
import './App.css';
import MyComponent from 'mycomponent'

function App() {
  const increment = "Increment"
  const decrement = "Decrement"
  const[count, setCount] = useState(99);
  return (
    <div className="App">
      <h1>Hello</h1>
      <MyComponent 
      increment = {increment}
      iecrement ={iecrement}
      count = {count}
      setCount = {setCount}
      />
    </div> 
  );
}

export default App;
